package main

import (
	"fmt"
	"math/big"
	"rsaDecrypt"
)

func main() {
	n, _ := new(big.Int).SetString("", 10)
	c, _ := new(big.Int).SetString("", 10)
	e, _ := new(big.Int).SetString("", 10)

	plaintext, _ := rsaDecrypt.WienerAttack(rsaDecrypt.PublicInfo{N: n, C: c, E: e})

	fmt.Printf("Flag: %s", plaintext.Bytes())
}
